import React from "react";

const Overview = ({ qouteResponse }) => {
  return (
    <div className="row">
      <div className="col-6">
        <div></div>
        <div> {qouteResponse.quoteResponse.result[0].longName}</div>
      </div>
      <div className="col-2"></div>
      <div className="col-2"></div>
      <div className="col-2"></div>
    </div>
  );
};

export default Overview;
